“Macao Maritime Info” is an application, developed by the Marine and Water Bureau of the Macao SAR, which aims to provide maritime information for citizens and tourists via mobile devices. Its main features include:
• Real time sailings – provide information on real time arriving and departing sailings at all ferry terminals;
• Sailing schedule – provide regular sailing schedules of all ferry routes;
• Real time sea conditions - provide camera views showing real time sea conditions in different areas;
• Tides – provide real time tidal heights and allow users to search for predicted tidal heights;
• Notice to mariners – provide the latest navigation information for vessels;
Services at terminals – provide information on shops, ticket office, restaurants and services available in the terminals.
